import React from "react";

export default function StrategyTabSwitcher({ tabs, active, onSelect, onAdd }) {
  return (
    <div className="strategy-tab-header flex gap-3 mb-3 items-center">
      {tabs.map((tab) => (
        <div
          key={tab}
          className={`tab px-4 py-2 cursor-pointer rounded-t transition-all ${
            active === tab
              ? "border-b-2 border-white text-white font-bold bg-zinc-900"
              : "text-zinc-400 hover:text-white"
          }`}
          onClick={() => onSelect(tab)}
        >
          {tab}
        </div>
      ))}
      <div
        className="tab add-tab px-4 py-2 cursor-pointer text-blue-400 hover:text-blue-300"
        onClick={onAdd}
      >
        + Add
      </div>
    </div>
  );
}
